/*BASE DE DATOS PARA 2640DATABASE*//*AUTORES: Juan Pablo Linares, Jairo Combita, Luis Rodriguez*//*DESCRIPCIÓN DE LA BASE DE DATOS: Esta base de datos integra todos los datos */CREATE TABLE Departamento(    ID_Departamento     NUMERIC(2,0),    Nombre_depart       VARCHAR2(70),    PRIMARY KEY (ID_Departamento));CREATE TABLE Ciudad(    ID_Departamento     NUMERIC(2,0),    ID_Ciudad           NUMERIC(4,0),    Nombre_ciudad       VARCHAR2(70),    PRIMARY KEY (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_Departamento) REFERENCES Departamento (ID_Departamento));CREATE TABLE Localidad_Municipio /*En esta tabla estamos hablando de las localidades o municipios cerca a bogota, se llama al ID del departamento del cual solo se podra escoger a Bogota o Cundinamarca*/(     ID_Localidad_Municipio        NUMERIC(20,0),    Nombre_Localidad_Municipio    VARCHAR2(40),    PRIMARY KEY (ID_Localidad_Municipio));CREATE TABLE SI_NO(        IdSN            NUMERIC(2,0),    opcSN           VARCHAR2(3),        PRIMARY KEY (IdSN));CREATE TABLE Ultima_Vez_Fuera_Residencia(/*Esta tabla es para la pregunta ¿Hace cuánto estuvo por última vez fuera de su actual lugar de residencia, por un periodo desde 3 días hasta 6 meses?. Para ver las opciones revisar la seccion de inserciones*/    idUV              NUMERIC(2,0),    opcUV             VARCHAR(60),        PRIMARY KEY (idUV));CREATE TABLE Periodos_Mas_6_Meses_Ciudad(/*Esta tabla es para la pregutna Aparte de los lugares donde nació y donde actualmente reside ¿ha estado por periodos de mas de 6 meses en otra ciudad o municipio en Colombia, o fuera de Colombia?*/    idPM              NUMERIC(2,0),    opcPM             VARCHAR(25),        PRIMARY KEY (idPM));CREATE TABLE Tiempo_Residencia( /*Esta tabla es para la pregutna ¿Cuánto tiempo duró esa residencia?*/    idTR              NUMERIC(2,0),    opcTR             VARCHAR(25),        PRIMARY KEY (idTR));CREATE TABLE Tiempo_Duro_Fuera(/*esta tabla es para la pregunta ¿Cúanto tiempo duró esa última (penúltima o ante-penúltima) residencia?*/    IdTDF             NUMERIC(2,0),    opcTDF            VARCHAR(25),        PRIMARY KEY (idTDF));CREATE TABLE Fumar_Ultima_Vez( /*Esta tabla es para la pregutna ¿Hace cuánto fumó por última vez?*/    idFUZ              NUMERIC(2,0),    opcFUZ             VARCHAR(25),        PRIMARY KEY (idFUZ));CREATE TABLE Fumar_Frecuencia(/*Esta tabla es para la pregutna ¿Con qué frecuencia fuma o fumaba?*/    idFF               NUMERIC(2,0),    opcFF              VARCHAR(25),        PRIMARY KEY (idFF));CREATE TABLE Fumar_Determinado_Dia(/* Esta tabla es para la pregutna ¿Cuántos cigarrillos podría fumar, o haber fumado, en un determinado día?*/    idDD               NUMERIC(2,0),    opcDD              VARCHAR(25),        PRIMARY KEY (idDD)); CREATE TABLE Estudia_Trabaja(    idET               NUMERIC(2,0),    opcET              VARCHAR(25),        PRIMARY KEY (idET) ); CREATE TABLE Tipo_Institucion_Bogota(    idET             NUMERIC(2,0),    idTIB             NUMERIC(2,0),    opcET            VARCHAR(40),            PRIMARY KEY (idTIB),    FOREIGN KEY (idET) REFERENCES Estudia_Trabaja (idET),    CHECK (idET = 1) /*para que solo sea si es Bogota*/); CREATE TABLE Universidad(    idTIB               NUMERIC(2,0),    idU                 NUMERIC(2,0) PRIMARY KEY,            Nombre_Universidad  VARCHAR(70),    FOREIGN KEY (idTIB) REFERENCES Tipo_Institucion_Bogota (idTIB),    CHECK (idTIB = 1) /*para que solo sea si es Universidad*/);  CREATE TABLE Insititucion_Universitaria(    idTIB                 NUMERIC(2,0),    idIU                 NUMERIC(2,0),            Nombre_Insti_Uni     VARCHAR(120),        PRIMARY KEY (idIU),    FOREIGN KEY (idTIB) REFERENCES Tipo_Institucion_Bogota (idTIB),    CHECK (idTIB = 2) /*para que solo sea si es Institucion Universitaria*/);CREATE TABLE Insititucion_Tecnologica(    idTIB                 NUMERIC(2,0),    idIT                 NUMERIC(2,0),            Nombre_Insti_Tec     VARCHAR(120),        PRIMARY KEY (idIT),    FOREIGN KEY (idTIB) REFERENCES Tipo_Institucion_Bogota (idTIB),    CHECK (idTIB = 3) /*para que solo sea si es Institucion Tecnologica*/);CREATE TABLE Insititucion_Tecnologica_Profesional(    idTIB                 NUMERIC(2,0),    idITP                NUMERIC(2,0),            Nombre_Insti_Tec_Pro VARCHAR(120),            PRIMARY KEY (idITP),    FOREIGN KEY (idTIB) REFERENCES Tipo_Institucion_Bogota (idTIB),    CHECK (idTIB = 4) /*para que solo sea si es Institucion Tecnologica*/);CREATE TABLE Institucion_Cundinamarca(    idET             NUMERIC(2,0),    idIC             NUMERIC(2,0),    Nombre_Insti_Cu  VARCHAR(150),        PRIMARY KEY (idIC),    FOREIGN KEY (idET) REFERENCES Estudia_Trabaja (idET),    CHECK (idET = 2) /*para que solo sea si es Cundinamarca*/);CREATE TABLE Sexo(    idSexo              NUMERIC(2,0),    opcSexo             VARCHAR2(12),        PRIMARY KEY (idSexo));CREATE TABLE Altura_Nacimiento(    idAN                NUMERIC(2,0),    opcAN               VARCHAR2(25),        PRIMARY KEY (idAN));CREATE TABLE Riesgo_Cardio(/*Tabla usada para los checkbox en el segundo formulario, al exportar las opsciones que le dieron check se guardan como 1 y los uncheck como 0*/    idRC                NUMERIC(2,0),    opcRC               VARCHAR2(50),        PRIMARY KEY (idRC));CREATE TABLE Electrocardiograma(    idElc               NUMERIC(2,0),    opcElc              VARCHAR2(50),        PRIMARY KEY (idElc));CREATE TABLE Aptitud(    idApt               NUMERIC(2,0),    opcApt              VARCHAR2(10),        PRIMARY KEY (idApt));CREATE TABLE Medida_Mascara(    idMM                NUMERIC(2,0),    opcMM              VARCHAR2(15),        PRIMARY KEY (idMM));CREATE TABLE Medida_Arnes(    idMA                NUMERIC(2,0),    opcMA              VARCHAR2(10),        PRIMARY KEY (idMA));CREATE TABLE Complit(    idC               NUMERIC(2,0),    opcC              VARCHAR(25),        PRIMARY KEY (idC));   CREATE TABLE Sujeto_Prueba(    /*INFORMACIÓN GENERAL*/    Idsp                VARCHAR2 (50) PRIMARY KEY, /*ID del sujeto de prueba */    fir_nam             VARCHAR2 (50), /*Nombre sujeto prueba*/    las_na1             VARCHAR2 (50), /*Apellido sujeto prueba*/    las_na2             VARCHAR2 (50), /*Segundo apellido*/    sex                 NUMERIC(2,0), /*sexo*/    dat_bir             DATE, /*fecha nacimiento*/    idn_num             VARCHAR2 (10), /*Número de su documento de identificación como ciudadado colombiano*/        FOREIGN KEY (sex) REFERENCES Sexo (idSexo));/*primero formulario*/CREATE TABLE Formulario_Aplicacion /*primer punto que aparece en RedCap*/(    Idsp                VARCHAR2 (50) PRIMARY KEY, /*ID del sujeto de prueba */    ID_Tratamineto_Dat  NUMERIC(2,0), /*Descargué y abrí el documento: Directrices tratamiwnto datos personales PUJ.pdf desde el respectivo enlace suministrado en este formulario.*/    ID_Av_Privacidad    NUMERIC(2,0), /*Descargué y abrí el documento: Aviso Privacidad Estudio test2640altura v1, sdjunto a este formulario */    /*PROCEDECIA*/    /*¿A qué departamento pertenece la ciudad o municipio donde usted nació?*/    ID_Dept_naci        NUMERIC(2,0),    ID_Ciud_naci        NUMERIC(4,0),         /*¿A qué departamento pertenece la ciudad o municipio donde fue expedida su cédula de ciudadanía?*/    ID_Dept_cedu        NUMERIC(2,0),    ID_Ciud_cedu        NUMERIC(4,0),    /*RESIDENCIA ACTUAL*/    /*¿Reside actualmente en Bogota o en un municipio aledano?*/    ID_Reside           NUMERIC(2,0), /*si o no*/    ID_Localidad_Municipio NUMERIC(20,0),/*Si reside, aca se guarda el ID de la localidad de en Bogota*/    Otro_Reside         VARCHAR2(40), /*Si selecciona otro, aca se guarda*/    /*ESTADÍAS ANTERIORES*/    /*¿Hace cuánto estuvo por ultima vez fuera de su actual lugar de residensia, por un periodo de 3 días hasta 6 meses*/    ID_tiempo_afuera    NUMERIC(2,0),/*Si oprime la opcion de que nunca ha salido, no se guardan los siguientes valores*/    ID_Dept_ult_fuera   NUMERIC(2,0),    ID_Ciud_ult_fuera   NUMERIC(4,0),    Otro_ult_fuera      VARCHAR2(40), /*Si selecciona otro, aca se guarda*/    /*Aparte de los lugares donde nació y donde actualmente reside ¿ha estado por periodos de mas de 6 meses en otra ciudad o municipio en Colombia, o fuera de Colombia?*/    ID_periodos_mas     NUMERIC(2,0), /*dependiendo de la cantidad de ocaciones se despliegan las casillas*/    /*RESIDENCIA ANTERIOR*/    ID_dept_ult_reside  NUMERIC(2,0),/*departamento última residencia*/    ID_ciud_ult_reside  NUMERIC(4,0),/*ciudad última residencia*/    Otro_ult_reside     VARCHAR2(40), /*Si selecciona otro, aca se guarda*/    ID_tiempo_ult_reside NUMERIC(2,0),/*tiempo última residencia*/        ID_dept_pult_reside NUMERIC(2,0),/*departamento penúltima residencia*/    ID_ciud_pult_reside NUMERIC(4,0),/*ciudad penúltima residencia*/    Otro_pult_reside    VARCHAR2(40), /*Si selecciona otro, aca se guarda*/    ID_tiempo_pult_reside  NUMERIC(2,0),/*tiempo penúltima residencia*/        ID_dept_ault_reside NUMERIC(2,0),/*departamento ante-penúltima residencia*/    ID_ciud_ault_reside NUMERIC(4,0),/*ciudad ante-penúltima residencia*/    Otro_ault_reside    VARCHAR2(40), /*Si selecciona otro, aca se guarda*/    ID_tiempo_ault_reside  NUMERIC(2,0),/*tiempo ante-penúltima residencia*/        /*INFORMACION BIOMETRICA*/    Estatura            NUMERIC(3,0),    Peso                NUMERIC(3,0),        /*OTRA INFORMACION*/    ID_Impedimento_Bici NUMERIC(2,0),    Que_impedimento     VARCHAR2(40),    ID_Fuma             NUMERIC(2,0),        /*ANTECEDENTES TABAQUISMO*/    Edad_fumo_primera   NUMERIC(3,0),    ID_Ultima_vez_fumo  NUMERIC(2,0),    ID_Frecuencia_fuma  NUMERIC(2,0),    ID_CigarrillosXdia  NUMERIC(2,0),        /*VINCULACION INSTITUCIONAL*/    ID_Miembro_ejercito NUMERIC(2,0),    ID_Sel_deport_dist  NUMERIC(2,0), /*¿Hace, o ha hecho parte, de una selección deportiva de orden distrital, departamental o nacional?*/    Cual_sel_deport     VARCHAR2(25),    ID_Estudia_insti    NUMERIC(2,0),/*¿Actualmente estudia o trabaja en una institución de educación superior en Bogota o Cundinamarca?*        /*Para Bogota*/    ID_Tipo_Insti       NUMERIC(2,0),        ID_Univerisdad      NUMERIC(2,0),/*Si la opcion de ID_Tipo_Insti es igual a 1*/    Otra_Uni            VARCHAR2(70),        ID_Insti_Uni        NUMERIC(2,0),/*Si la opcion de ID_Tipo_Insti es igual a 2*/    Otra_Insti_Uni      VARCHAR2(70),        ID_Insti_Tec        NUMERIC(2,0),/*Si la opcion de ID_Tipo_Insti es igual a 3*/    Otra_Insti_Tec      VARCHAR2(70),        ID_Insti_Tec_Pro    NUMERIC(2,0),/*Si la opcion de ID_Tipo_Insti es igual a 4*/    Otra_Insti_Tec_Pro  VARCHAR2(70),    /*Para Cundinamarca*/    ID_Insti_Cund       NUMERIC(2,0),/*Si la opcion de ID_Estudia_insti es Cundinamarca*/    Otra_Insti_Cund     VARCHAR2(70),        /*CONTACTO*/    Correo              VARCHAR2(25),    Correo_sec          VARCHAR2(25),    Telefono            VARCHAR2(10),    Celular             VARCHAR2(10),        /*FORM STATUS*/    ID_complite            NUMERIC(2,0),        FOREIGN KEY (Idsp) REFERENCES Sujeto_Prueba (Idsp),    FOREIGN KEY (ID_Tratamineto_Dat) REFERENCES SI_NO(IdSN),    FOREIGN KEY (ID_Av_Privacidad) REFERENCES SI_NO(IdSN),    FOREIGN KEY (ID_Dept_naci) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_Ciud_naci,ID_Dept_naci) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_Dept_cedu) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_Ciud_cedu,ID_Dept_cedu) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_Reside) REFERENCES SI_NO(IdSN),    FOREIGN KEY (ID_Localidad_Municipio) REFERENCES Localidad_Municipio (ID_Localidad_Municipio),    FOREIGN KEY (ID_tiempo_afuera) REFERENCES Ultima_Vez_Fuera_Residencia (idUV),    FOREIGN KEY (ID_Dept_ult_fuera) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_Ciud_ult_fuera,ID_Dept_ult_fuera) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_periodos_mas) REFERENCES Periodos_Mas_6_Meses_Ciudad (idPM),    FOREIGN KEY (ID_dept_ult_reside) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_ult_reside,ID_dept_ult_reside) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_tiempo_ult_reside) REFERENCES Tiempo_Residencia (idTR),    FOREIGN KEY (ID_dept_pult_reside) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_pult_reside,ID_dept_pult_reside) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_tiempo_pult_reside) REFERENCES Tiempo_Residencia (idTR),    FOREIGN KEY (ID_dept_ault_reside) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_ault_reside,ID_dept_ault_reside) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_tiempo_ault_reside) REFERENCES Tiempo_Residencia (idTR),    FOREIGN KEY (ID_Impedimento_Bici) REFERENCES SI_NO(IdSN),    FOREIGN KEY (ID_Fuma) REFERENCES SI_NO(IdSN),    FOREIGN KEY (ID_Ultima_vez_fumo) REFERENCES Fumar_Ultima_Vez (idFUZ),    FOREIGN KEY (ID_Frecuencia_fuma) REFERENCES Fumar_Frecuencia (idFF),    FOREIGN KEY (ID_CigarrillosXdia) REFERENCES Fumar_Determinado_Dia (idDD),    FOREIGN KEY (ID_Miembro_ejercito) REFERENCES SI_NO(IdSN),    FOREIGN KEY (ID_Sel_deport_dist) REFERENCES SI_NO(IdSN),    FOREIGN KEY (ID_Estudia_insti) REFERENCES Estudia_Trabaja (idET),    FOREIGN KEY (ID_Tipo_Insti) REFERENCES Tipo_Institucion_Bogota (idTIB),         FOREIGN KEY (ID_Univerisdad) REFERENCES Universidad (idU),    /*FOREIGN KEY (Otra_Uni) REFERENCES Universidad (Nombre_Universidad),*/    FOREIGN KEY (ID_Univerisdad) REFERENCES Insititucion_Universitaria (idIU),    /*FOREIGN KEY (Otra_Insti_Uni) REFERENCES Insititucion_Universitaria (Nombre_Insti_Uni),*/        FOREIGN KEY (ID_Insti_Uni) REFERENCES Insititucion_Tecnologica (idIT),    /*FOREIGN KEY (Otra_Insti_Tec) REFERENCES Insititucion_Tecnologica (Nombre_Insti_Tec),*/            FOREIGN KEY (ID_Insti_Tec) REFERENCES Insititucion_Tecnologica_Profesional (idITP),    /*FOREIGN KEY (Otra_Insti_Tec_Pro) REFERENCES Insititucion_Tecnologica_Profesional (Nombre_Insti_Tec_Pro),*/            FOREIGN KEY (ID_Insti_Cund) REFERENCES Institucion_Cundinamarca (idIC),    /*FOREIGN KEY (Otra_Insti_Cund) REFERENCES Institucion_Cundinamarca (Nombre_Insti_Cu)*/    FOREIGN KEY (ID_Complite) REFERENCES Complit (idC)           );CREATE TABLE Formulario_dos(    Idsp                VARCHAR2 (50) PRIMARY KEY, /*ID del sujeto de prueba */    ID_altura_naci      NUMERIC(1,0),    dat_res_lal_e2	    DATE, /*¿Hasta qué fecha aproximada residió en forma permanente en poblaciones ubicadas a menos de 500 m?*/        dat_res_mal_e2      DATE, /*¿En qué fecha aproximada INICIÓ SU RESIDENCIA PERMANENTE en Bogota o en poblaciones de altitud similar (mas de 2.500 m)?*/    /*PROCEDECIA ANCESTROS MATERNOS*/    ID_dept_mama        NUMERIC(2,0),    ID_ciud_mama        NUMERIC(4,0),    Otro_mama           VARCHAR2(40),    /*abuela materna*/    ID_dept_a_mama      NUMERIC(2,0),    ID_ciud_a_mama      NUMERIC(4,0),    Otro_a_mama         VARCHAR2(40),    /*abuelo materno*/    ID_dept_o_mama      NUMERIC(2,0),    ID_ciud_o_mama      NUMERIC(4,0),    Otro_o_mama         VARCHAR2(40),    /*PROCEDENCIA ANCESTROS PATERNOS*/    ID_dept_papa        NUMERIC(2,0),    ID_ciud_papa        NUMERIC(4,0),    Otro_papa           VARCHAR2(40),    /*abuela paterna*/    ID_dept_a_papa      NUMERIC(2,0),    ID_ciud_a_papa      NUMERIC(4,0),    Otro_a_papa         VARCHAR2(40),    /*abuelo paterno*/    ID_dept_o_papa      NUMERIC(2,0),    ID_ciud_o_papa      NUMERIC(4,0),    Otro_o_papa         VARCHAR2(40),    /*RIESGO CARDIOVASCULAR*/    /*Diabetes del adulto (tipo 2),*/    ID_Diabetes_madre   NUMERIC(1,0),    ID_Diabetes_padre   NUMERIC(1,0),    ID_Diabetes_herms   NUMERIC(1,0),    /*Tensión alta (hipertensión arterial)*/    ID_Tension_madre    NUMERIC(1,0),    ID_Tension_padre    NUMERIC(1,0),    ID_Tension_herms    NUMERIC(1,0),    /*Colesterol o triglicéridos altos en la sangre (hiperlipidemia)*/    ID_Colest_madre     NUMERIC(1,0),    ID_Colest_padre     NUMERIC(1,0),    ID_Colest_herms     NUMERIC(1,0),    /*Trombosis o derrame cerebral (evento cerebro-vascular)*/    ID_Trombo_madre     NUMERIC(1,0),    ID_Trombo_padre     NUMERIC(1,0),    ID_Trombo_herms     NUMERIC(1,0),    /*Infarto o ataque cardiaco (evento cardio-vascular)*/    ID_Infarto_madre    NUMERIC(1,0),    ID_Infarto_padre    NUMERIC(1,0),    ID_Infarto_herms    NUMERIC(1,0),    /*Sobrepeso u obesidad*/    ID_Sobrepeso_madre  NUMERIC(1,0),    ID_Sobrepeso_padre  NUMERIC(1,0),    ID_Sobrepeso_herms  NUMERIC(1,0),        ID_complite            NUMERIC(2,0),        FOREIGN KEY (Idsp) REFERENCES Sujeto_Prueba (Idsp),    FOREIGN KEY (ID_altura_naci) REFERENCES Altura_Nacimiento (IdAN),        FOREIGN KEY (ID_dept_mama) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_mama,ID_dept_mama) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_dept_a_mama) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_a_mama,ID_dept_a_mama) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_dept_o_mama) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_o_mama,ID_dept_o_mama) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_dept_papa) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_papa,ID_dept_papa) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_dept_a_papa) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_a_papa,ID_dept_a_papa) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_dept_o_papa) REFERENCES Departamento (ID_Departamento),    FOREIGN KEY (ID_ciud_o_papa,ID_dept_o_papa) REFERENCES Ciudad (ID_Ciudad,ID_Departamento),    FOREIGN KEY (ID_Diabetes_madre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Diabetes_padre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Diabetes_herms) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Tension_madre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Tension_padre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Tension_herms) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Colest_madre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Colest_padre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Colest_herms) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Trombo_madre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Trombo_padre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Trombo_herms) REFERENCES Riesgo_Cardio (idRC),        FOREIGN KEY (ID_Infarto_madre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Infarto_padre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Infarto_herms) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Sobrepeso_madre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Sobrepeso_padre) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Sobrepeso_herms) REFERENCES Riesgo_Cardio (idRC),    FOREIGN KEY (ID_Complite) REFERENCES Complit (idC)    );CREATE TABLE Evaluacion_Antropometrica(    Idsp                VARCHAR2 (50) PRIMARY KEY, /*ID del sujeto de prueba */    /*DATOS ANTROPOMÉTRICOS*/    Estatura            NUMERIC(3,0),    Peso_corp_total     NUMERIC(3,0),    /*Perímetros*/    Per_cintura         NUMERIC(5,2),    Per_br_rela         NUMERIC(5,2),/*brazo relajado*/    Per_br_cont         NUMERIC(5,2),/*brazo contraído*/    Per_torax           NUMERIC(5,2),    Per_pierna          NUMERIC(