 KEY (ID_Dolor_toracico) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_Sincope) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_Disnea) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_Soplo_car_pre) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_Presion_art) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_Est_card) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_apt_dep) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_muerte_pre) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_disca_enfe) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_cond_card) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_soplo_car) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_pulso_fero) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_marfan) REFERENCES SI_NO (IdSN),    FOREIGN KEY (ID_elec_car) REFERENCES Electrocardiograma (idElc),    FOREIGN KEY (ID_aptitud) REFERENCES Aptitud (idApt),        FOREIGN KEY (ID_Complite) REFERENCES Complit (idC));CREATE TABLE Ingreso_Laboratorio_Clinico(        Idsp                VARCHAR2 (50) PRIMARY KEY, /*ID del sujeto de prueba */    Fecha_eva           DATE,    /*Pregunte al participante sobre los siguientes momentos:*/    Fecha_cons          DATE,/*Fecha y hora en la que consumió por última vez algún tipo de alimento o bebida:*/    Tiempo_ayuno        NUMERIC(2,0),    Fecha_dorm          DATE,/*Fecha y hora en la que se acostó a dormir*/    Fecha_leva          DATE,/*Fecha y hora en la que se levantó*/    Tiempo_sueno        NUMERIC(2,0),    Dias_mens           NUMERIC(3,0),    /*Pregunte al participante sobre los siguientes antecedentes*/    ID_act_fis             NUMERIC(1,0),/*¿Ha realizado algún tipo de actividad física en las últimas 24 horas?*/    ID_alch_dia            NUMERIC(1,0),/*¿Ha consumido alcohol en los últimos tres días?*/    ID_sint_enf            NUMERIC(1,0),/*¿Ha tenido síntomas de enfermedad / infección en la última semana?*/    ID_cons_med            NUMERIC(1,0),/*¿Ha consumido algún medicamento en la última semana?*/    ID_dieta      